import { Grid ,Container} from '@mui/material'
import Cards from './Cards';
import one from './1.png';
import two from './11.png';
import three from './3.png';
import four from './4.png';
import five from './5.png';
import six from './6.png';
import seven from './7.png';
import eight from './8.png';
import nine from './9.png';
function FinishedBooks(){
    return (
<Container >
      <Grid container rowSpacing={3} >
        <Grid item xs={12} sm={6} md={4}>
          <Cards imag={one} name="Bring Your Human to Work" author="Erica Keswin" duration="13"/>
        </Grid>

        <Grid item xs={12} sm={6} md={4}>
        <Cards imag={two} name="Employee to Entrepreneur" author="Steve Glaveski" duration="15"/>
        </Grid>

      </Grid>
      </Container>
    );
}
export default FinishedBooks;
